export const Statistics = ({ title, stats }) => {
    return (
      <section class="statistics">
            <h2 class="title">Upload stats {title}</h2>
            <ul class="stat-list">
                {stats.map((stat) => {
                    <li class="item" key={stat.id}>
                        <span class="label">{stat.label}</span>
                        <span class="percentage">{stat.percentage}%</span>
                    </li>
                })} 
        </ul>
      </section>
    );
  };
